import React, { useState } from 'react'
import { useDispatch } from 'react-redux';
import { setSearchQuery } from '../../../features/currentCityOrHostel';

const Search = () => {
    const [query, setQuery] = useState('');
    const dispatch = useDispatch();
    const handleKeyPress = (event) => {
        if(event.key === "Enter"){
            dispatch(setSearchQuery(query));
        }
    }
    const top20CitiesIndia = [
        'Mumbai',
        'Delhi',
        'Bangalore',
        'Hyderabad',
        'Ahmedabad',
        'Chennai',
        'Kolkata',
        'Surat',
        'Pune',
        'Jaipur',
        'Lucknow',
        'Kanpur',
        'Nagpur',
        'Visakhapatnam',
        'Indore',
        'Thane',
        'Bhopal',
        'Patna',
        'Vadodara',
        'Ghaziabad'
      ];
  return (
    <div className='text-black flex items-center justify-center'>
        <select id="cars" className='p-2 rounded'>
            {top20CitiesIndia.map((cityName)=>{
                return <option key={cityName}>{cityName}</option>
            })}
        </select>
        <input
            className='w-[40%] p-2 rounded text-black '
            type="text"
            placeholder="Search for a Place, Area"
            value={query}
            onChange={e => setQuery(e.value)}
            onKeyDown={handleKeyPress}
        />
        <div>icon</div>
    </div>
  )
}

export default Search
